        _name = "Inu Empire";
        _symbol = "inuEMPIRE";
        _router = router;
        _supply = supply;
        
    // Generate TotalSupply    
        _totalSupply += _supply;
        _balances[_msgSender()] += _totalSupply;
        emit Transfer(address(0), _msgSender(), _totalSupply);
